export const prices = [
  {
    name: 'Tout',
    min: 0,
    max: 0,
  },
  {
    name: `$1 to $50`,
    min: 1,
    max: 50,
  },
  {
    name: `$50 to $100`,
    min: 50,
    max: 100,
  },
  {
    name: `$100 to $200`,
    min: 100,
    max: 200,
  },
];
